import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';
import Navbar from './components/Navbar';
import Home from './components/Home';
import AsianCulture from './components/AsianCulture';
import AfricanCulture from './components/AfricanCulture';
import EuropeanCulture from './components/EuropeanCulture';
import AmericanCulture from './components/AmericanCulture';
import Footer from './components/Footer';

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/asian-culture" element={<AsianCulture />} />
          <Route path="/african-culture" element={<AfricanCulture />} />
          <Route path="/european-culture" element={<EuropeanCulture />} />
          <Route path="/american-culture" element={<AmericanCulture />} />
        </Routes>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
